    return (
      <React.Fragment>
        <div className="auth-wrapper">

          <div className="mb-5 container">
            {this.props.children}
          </div>

        </div>
        <style jsx>{`
          .auth-wrapper{
            
            min-height: 100vh;
          }
          
        `}</style>
      </React.Fragment>
    )
  }
}
